import React from "react";

class Prices extends React.Component {
  state = {
    currency: "USD",
  };
  render() {
    return (
      <div>
        <ul className="list-group">
          <li className="group-item">
            Bitcoin rate for {this.props.bpi.USD.discription}
          </li>
        </ul>
      </div>
    );
  }
}

export default Prices;
